import React from "react";


const steps = [
  { title: "Case Created\n& Truck Arrives Onsite" },
  { title: "Create RO\nfrom Decisiv Case" },
  { title: "Update Case\nwith Lines & Parts" },
  { title: "Send Initial\nEstimate to Customer" },
  { title: "Customer Approves\nEstimate" },
  { title: "Parts Picked or\nOrdered for RO" },
  { title: "Repair in\nProcess" },
  { title: "Technician Story\nWrite Up" },
  { title: "Service Advisor\nAdmin Work" },
  { title: "Notify Customer\nRepair is Complete" },
  { title: "Invoice\nCustomer" },
  { title: "Truck Departs\nService Location" },
];

const qabIndexes = [0, 4, 8];
const actionIndexes = [0, 4, 11];
const actionLabels = ["CHECK-IN", "REQUEST APPROVAL", "ASSET READY"];
const roleFilters = [
  { id: 'all', name: 'All Roles' },
  { id: 'service-advisor', name: 'Service Advisors' },
  { id: 'parts-staff', name: 'Parts Staff' },
  { id: 'technician', name: 'Foremen/Technicians' }
];
// For demo, no filter logic is implemented, just UI

export default function ProcessWorkflowLayout() {

  return (
    <div className="w-full max-w-6xl bg-white rounded-2xl shadow-xl p-8 flex flex-col gap-8">
      {/* Header */}
      <div className="flex justify-between items-center mb-2">
        <div>
          <h1 className="text-3xl font-bold text-slate-900">Service Management Process</h1>
          <p className="text-blue-700 font-semibold">Start Every Repair in Service Management</p>
        </div>
        <div className="flex items-center gap-2">
          <img src="/assets/images/kenworth-logo.png" alt="Kenworth Logo" className="h-12 w-12 rounded-lg bg-white shadow" />
          <span className="text-xs text-slate-700 font-bold">KENWORTH<br />TRUCKTECH+<br />Service Management</span>
        </div>
      </div>

      {/* Filter by Role - moved below header */}
      <div className="flex flex-wrap gap-2 mb-6 justify-center">
        <span className="text-slate-700 font-semibold mr-2">Filter by Role:</span>
        {roleFilters.map(role => (
          <button
            key={role.id}
            className="px-4 py-2 rounded-lg text-white font-medium bg-slate-700 hover:bg-slate-600 transition-all"
          >
            {role.name}
          </button>
        ))}
      </div>

      {/* Timeline Workflow - boxes above the line */}
      <div className="relative flex flex-col items-center">
        {/* Step Boxes above the line */}
        <div className="flex w-full justify-between items-end z-10 mb-6">
          {steps.map((step, idx) => (
            <div key={idx} className="flex flex-col items-center w-32">
              {/* Step Box */}
              <div className="bg-blue-100 border border-blue-400 rounded-lg px-3 py-2 text-center text-xs font-semibold whitespace-pre-line shadow-md mb-2">
                {step.title}
              </div>
              {/* QAB marker */}
              {qabIndexes.includes(idx) && (
                <div className="mt-2 flex flex-col items-center">
                  <div className="bg-yellow-400 rounded-full w-10 h-10 flex items-center justify-center font-bold text-black text-lg border-2 border-yellow-600 shadow">QAB</div>
                  <div className="h-4" />
                </div>
              )}
              {/* Action Button */}
              {actionIndexes.includes(idx) && (
                <button className="bg-blue-600 text-white px-3 py-1 rounded-lg font-bold text-xs shadow mt-2">
                  {actionLabels[actionIndexes.indexOf(idx)]}
                </button>
              )}
            </div>
          ))}
        </div>
        {/* Timeline Line */}
        <div className="w-full h-1 bg-blue-400 z-0" />
        {/* Timeline Labels */}
        <div className="flex w-full justify-between mt-2 text-slate-700 font-semibold text-sm">
          <span>Triage Time</span>
          <span>Dwell Time</span>
        </div>
      </div>

      {/* Bottom Section */}
      <div className="flex flex-col md:flex-row gap-6 mt-8">
        <div className="bg-yellow-400 rounded-lg p-6 flex-1 flex flex-col justify-center items-center shadow">
          <h3 className="text-xl font-bold text-blue-900 mb-2">Kenworth Goals</h3>
          <div className="text-blue-900 font-semibold text-lg">Triage: 4 Hours or less</div>
          <div className="text-blue-900 font-semibold text-lg">Dwell: 3 Days or less</div>
        </div>
        <div className="flex-1">
          <h3 className="text-xl font-bold mb-2 text-slate-900">Remember Every Case Needs:</h3>
          <ul className="list-disc list-inside text-slate-800 text-sm grid grid-cols-1 md:grid-cols-2 gap-x-4 gap-y-1">
            <li>Primary Email Contact</li>
            <li>Follow Up Time</li>
            <li>Case-Level Complaint</li>
            <li>Accurate Estimate Approvals</li>
            <li>Quick Action Button Usage</li>
            <li>Every Case Updated Twice Daily</li>
            <li>ETR- Estimated Time to Repair Populated</li>
            <li>Repair Order # from DBS</li>
          </ul>
        </div>
      </div>
    </div>
  );
}
